  List,
  ListItem,
  ListItemText,
  ListItemSecondaryAction
} from '@mui/material';
import {
  BusinessCenter,
  GroupAdd,
  TrendingUp,
  EmojiEvents,
  Close as CloseIcon,
  Delete as DeleteIcon
} from '@mui/icons-material';

interface TeamMember {
  id: string;
  name: string;
  role: string;
}

interface Achievement {
  id: string;
  title: string;
  description: string;
}

const StartupProfile: React.FC = () => {
  // Basic Information State
  const [startupInfo, setStartupInfo] = useState({
    name: '',
    industry: '',
    description: ''
  });

  // Team Members State
  const [teamMembers, setTeamMembers] = useState<TeamMember[]>([]);
  const [newTeamMember, setNewTeamMember] = useState({ name: '', role: '' });
  const [teamDialogOpen, setTeamDialogOpen] = useState(false);

  // Achievements State
  const [achievements, setAchievements] = useState<Achievement[]>([]);
  const [newAchievement, setNewAchievement] = useState({ title: '', description: '' });
  const [achievementDialogOpen, setAchievementDialogOpen] = useState(false);

  // Basic Info Handlers
  const handleInputChange = (e: React.ChangeEvent<HTMLInputElement | HTMLTextAreaElement>) => {
    setStartupInfo({
      ...startupInfo,
      [e.target.name]: e.target.value
    });
  };

  const handleSaveProfile = () => {
    // TODO: Implement API call to save profile
    console.log('Saving profile:', startupInfo);
    alert('Profile saved successfully!');
  };

  // Business Plan Handlers
  const handleUploadBusinessPlan = (e: React.ChangeEvent<HTMLInputElement>) => {
    const file = e.target.files?.[0];
    if (file) {
      // TODO: Implement file upload logic
      console.log('Uploading business plan:', file.name);
      alert('Business plan uploaded successfully!');
    }
  };

  // Team Members Handlers
  const handleAddTeamMember = () => {
    if (newTeamMember.name && newTeamMember.role) {
      setTeamMembers([
        ...teamMembers,
        { ...newTeamMember, id: Date.now().toString() }
      ]);
      setNewTeamMember({ name: '', role: '' });
      setTeamDialogOpen(false);
    }
  };

  const handleDeleteTeamMember = (id: string) => {
    setTeamMembers(teamMembers.filter(member => member.id !== id));
  };

  // Financial Projections Handler
  const handleUploadProjections = (e: React.ChangeEvent<HTMLInputElement>) => {
    const file = e.target.files?.[0];
    if (file) {
      // TODO: Implement file upload logic
      console.log('Uploading financial projections:', file.name);
      alert('Financial projections uploaded successfully!');
    }
  };

  // Achievements Handlers
  const handleAddAchievement = () => {
    if (newAchievement.title && newAchievement.description) {
      setAchievements([
        ...achievements,
        { ...newAchievement, id: Date.now().toString() }
      ]);
      setNewAchievement({ title: '', description: '' });
      setAchievementDialogOpen(false);
    }
  };

  const handleDeleteAchievement = (id: string) => {
    setAchievements(achievements.filter(achievement => achievement.id !== id));
  };

  return (
    <Box sx={{ p: 3 }}>
      <Typography variant="h4" gutterBottom>
        Startup Profile
      </Typography>

      {/* Basic Profile Form */}
      <Card sx={{ mb: 4 }}>
        <CardContent>
          <Typography variant="h5" gutterBottom>Basic Information</Typography>
          <Box component="form" sx={{ display: 'flex', flexDirection: 'column', gap: 2 }}>
            <TextField 
              label="Startup Name" 
              name="name"
              value={startupInfo.name}
              onChange={handleInputChange}
              variant="outlined" 
              fullWidth 
            />
            <TextField 
              label="Industry" 
              name="industry"
              value={startupInfo.industry}
              onChange={handleInputChange}
              variant="outlined" 
              fullWidth 
            />
            <TextField 
              label="Description" 
              name="description"
              value={startupInfo.description}
              onChange={handleInputChange}
              variant="outlined" 
              fullWidth 
              multiline 
              rows={4} 
            />
            <Button 
              variant="contained" 
              color="primary"
              onClick={handleSaveProfile}
            >
              Save Profile
            </Button>
          </Box>
        </CardContent>
      </Card>

      {/* Complete Your Profile Section */}
      <Card>
        <CardContent>
          <Typography variant="h5" gutterBottom>Complete Your Profile</Typography>
          <Typography variant="body2" color="text.secondary" paragraph>
            Finish these items to improve your matches and visibility to investors
          </Typography>

          <Box sx={{ 
            display: 'grid', 
            gridTemplateColumns: { 
              xs: '1fr',
              sm: 'repeat(2, 1fr)',
              md: 'repeat(4, 1fr)'
            },
            gap: 2,
            mt: 1
          }}>
            {/* Business Plan Card */}
            <Paper 
              elevation={0} 
              sx={{ 
                p: 2, 
                height: '100%',
                bgcolor: 'background.default',
                border: '1px solid',
                borderColor: 'divider',
                borderRadius: 2,
                display: 'flex',
                flexDirection: 'column'
              }}
            >
              <Box sx={{ display: 'flex', alignItems: 'center', mb: 2 }}>
                <BusinessCenter color="primary" sx={{ mr: 1 }} />
                <Typography variant="h6">Business Plan</Typography>
              </Box>
              <Typography variant="body2" sx={{ mb: 2, flexGrow: 1 }}>
                Upload your business plan document to share with potential investors
              </Typography>
              <Button
                variant="outlined"
                component="label"
                fullWidth
              >
                Upload
                <input
                  type="file"
                  hidden
                  accept=".pdf,.doc,.docx"
                  onChange={handleUploadBusinessPlan}
                />
              </Button>
            </Paper>

            {/* Team Members Card */}
            <Paper 
              elevation={0} 
              sx={{ 
                p: 2, 
                height: '100%',
                bgcolor: 'background.default',
                border: '1px solid',
                borderColor: 'divider',
                borderRadius: 2,
                display: 'flex',
                flexDirection: 'column'
              }}
            >
              <Box sx={{ display: 'flex', alignItems: 'center', mb: 2 }}>
                <GroupAdd color="primary" sx={{ mr: 1 }} />
                <Typography variant="h6">Team Members</Typography>
              </Box>
              <Typography variant="body2" sx={{ mb: 2, flexGrow: 1 }}>
                Add your team members and their roles to showcase your talent
              </Typography>
              <Button 
                variant="outlined" 
                fullWidth
                onClick={() => setTeamDialogOpen(true)}
              >
                Add Team
              </Button>
            </Paper>

            {/* Financial Projections Card */}
            <Paper 
              elevation={0} 
              sx={{ 
                p: 2, 
                height: '100%',
                bgcolor: 'background.default',
                border: '1px solid',
                borderColor: 'divider',
                borderRadius: 2,
                display: 'flex',
                flexDirection: 'column'
              }}
            >
              <Box sx={{ display: 'flex', alignItems: 'center', mb: 2 }}>
                <TrendingUp color="primary" sx={{ mr: 1 }} />
                <Typography variant="h6">Financial Projections</Typography>
              </Box>
              <Typography variant="body2" sx={{ mb: 2, flexGrow: 1 }}>
                Add your financial projections to demonstrate growth potential
              </Typography>
              <Button
                variant="outlined"
                component="label"
                fullWidth
              >
                Add Projections
                <input
                  type="file"
                  hidden
                  accept=".xlsx,.xls,.csv"
                  onChange={handleUploadProjections}
                />
              </Button>
            </Paper>

            {/* Achievements Card */}
            <Paper 
              elevation={0} 
              sx={{ 
                p: 2, 
                height: '100%',
                bgcolor: 'background.default',
                border: '1px solid',
                borderColor: 'divider',
                borderRadius: 2,
                display: 'flex',
                flexDirection: 'column'
              }}
            >
              <Box sx={{ display: 'flex', alignItems: 'center', mb: 2 }}>
                <EmojiEvents color="primary" sx={{ mr: 1 }} />
                <Typography variant="h6">Achievements</Typography>
              </Box>
              <Typography variant="body2" sx={{ mb: 2, flexGrow: 1 }}>
                Highlight your milestones, awards, and key achievements
              </Typography>
              <Button 
                variant="outlined" 
                fullWidth
                onClick={() => setAchievementDialogOpen(true)}
              >
                Add Achievements
              </Button>
            </Paper>
          </Box>
        </CardContent>
      </Card>

      {/* Team Members Dialog */}
      <Dialog open={teamDialogOpen} onClose={() => setTeamDialogOpen(false)} maxWidth="sm" fullWidth>
        <DialogTitle>
          Add Team Member
          <IconButton
            aria-label="close"
            onClick={() => setTeamDialogOpen(false)}
            sx={{ position: 'absolute', right: 8, top: 8 }}
          >
            <CloseIcon />
          </IconButton>
        </DialogTitle>
        <DialogContent>
          <Box sx={{ mt: 2, display: 'flex', flexDirection: 'column', gap: 2 }}>
            <TextField
              label="Name"
              value={newTeamMember.name}
              onChange={(e) => setNewTeamMember({ ...newTeamMember, name: e.target.value })}
              fullWidth
            />
            <TextField
              label="Role"
              value={newTeamMember.role}
              onChange={(e) => setNewTeamMember({ ...newTeamMember, role: e.target.value })}
              fullWidth
            />
          </Box>
          {teamMembers.length > 0 && (
            <List sx={{ mt: 2 }}>
              {teamMembers.map((member) => (
                <ListItem key={member.id}>
                  <ListItemText primary={member.name} secondary={member.role} />
                  <ListItemSecondaryAction>
                    <IconButton edge="end" onClick={() => handleDeleteTeamMember(member.id)}>
                      <DeleteIcon />
                    </IconButton>
                  </ListItemSecondaryAction>
                </ListItem>
              ))}
            </List>
          )}
        </DialogContent>
        <DialogActions>
          <Button onClick={() => setTeamDialogOpen(false)}>Cancel</Button>
          <Button onClick={handleAddTeamMember} variant="contained" color="primary">
            Add
          </Button>
        </DialogActions>
      </Dialog>

      {/* Achievements Dialog */}
      <Dialog open={achievementDialogOpen} onClose={() => setAchievementDialogOpen(false)} maxWidth="sm" fullWidth>
        <DialogTitle>
          Add Achievement
          <IconButton
            aria-label="close"
            onClick={() => setAchievementDialogOpen(false)}
            sx={{ position: 'absolute', right: 8, top: 8 }}
          >
            <CloseIcon />
          </IconButton>
        </DialogTitle>
        <DialogContent>
          <Box sx={{ mt: 2, display: 'flex', flexDirection: 'column', gap: 2 }}>
            <TextField
              label="Title"
              value={newAchievement.title}
              onChange={(e) => setNewAchievement({ ...newAchievement, title: e.target.value })}
              fullWidth
            />
            <TextField
              label="Description"
              value={newAchievement.description}
              onChange={(e) => setNewAchievement({ ...newAchievement, description: e.target.value })}
              fullWidth
              multiline
              rows={3}
            />
          </Box>
          {achievements.length > 0 && (
            <List sx={{ mt: 2 }}>
              {achievements.map((achievement) => (
                <ListItem key={achievement.id}>
                  <ListItemText primary={achievement.title} secondary={achievement.description} />
                  <ListItemSecondaryAction>
                    <IconButton edge="end" onClick={() => handleDeleteAchievement(achievement.id)}>
                      <DeleteIcon />
                    </IconButton>
                  </ListItemSecondaryAction>
                </ListItem>
              ))}
            </List>
          )}
        </DialogContent>
        <DialogActions>
          <Button onClick={() => setAchievementDialogOpen(false)}>Cancel</Button>
          <Button onClick={handleAddAchievement} variant="contained" color="primary">
            Add
          </Button>
        </DialogActions>
      </Dialog>
    </Box>
  );
};

export default StartupProfile;
